import React, {useEffect} from "react";

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Home from "./Home";
import Menu from "./Menu";
import Gallery from "./Gallery";
import Footer from "./Footer";
import reviews from './images/reviews.jpg';
import { Facebook, Instagram, Twitter } from '@material-ui/icons';

import './App.css';

function App() {

    let index = 0;
    useEffect(() => {
        setTimeout(() => {
            const inds = document.querySelectorAll('.testInd');
            inds.forEach((ind, index) => {
                inds[index].classList.remove('indActive');
            })
            inds[index].classList.add('indActive');
            index++;
            setInterval(() => {
                const inds = document.querySelectorAll('.testInd');
                if (index > inds.length - 1) {
                    index= 0;
                }
                inds.forEach((ind, index) => {
                    inds[index].classList.remove('indActive');
                })
                inds[index].classList.add('indActive');
                index++;
            }, 9999);
        }, 1500)
    }, [])

  return (
    <div className="App parallax col-12">
        <Home />
        <Menu />
        <div className='about parallax-group flex col-12 col-m-12 col-l-12'>
            <img className='parallax-layer parallax-back' src={reviews} />
            <div className='parallax-layer parallax-back aboutFilter' />
            <div className='parallax-layer parallax-base aboutText flex'>
                <h1>About Us</h1>
                <p>Located in the heart of Osborne Village, we've been providing the community with giant, delicious burritos and tacos since 2007</p>
            </div>
        </div>
        <Gallery />
        <Footer />
        <div className='footer-final flex col-12 col-m-12 col-l-12'>
            <h5>Designed by Vision Web Design</h5>
            <div className='socials footer-socials flex col-m-2 col-l-1'>
                <Facebook className='social icon'/>
                <Twitter className='social icon'/>
                <Instagram className='social icon'/>
            </div>
        </div>
    </div>
  );
}

export default App;
